import './App.css';
import Details from './photoes/Details';
import Photo from './photoes/photo';
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Photo />} />
      <Route path="/detail/:id" element={<Details />} />
    </Routes>
  );
}

export default App;
